fun main(args: Array<String>) {
  val data = listOf("",
      "",
      "",
      "",
      "")

  //   1
  //  234
  // 56789
  //  ABC
  //   D

  val valueMap = arrayOf("1", "2", "3", "4", "5", "6", "7", "8", "9", "A", "B", "C", "D")

  var solution =""
  var value = 5
  for (line in data) {
    line.forEach {
      when (it) {
        'U' -> {
          if (value !in intArrayOf(1,2,4,5,9)) {
            if (value in intArrayOf(3, 13)) value -= 2 else value -=4
          }
        }
        'D' -> {
          if (value !in intArrayOf(5,9,10,12,13)) {
            if(value in intArrayOf(1, 11)) value += 2 else value +=4
          }
        }
        'L' -> {
          if (value !in intArrayOf(1,2,5,10,13)) value -= 1
        }
        'R' -> {
          if (value !in intArrayOf(1,4,9,12,13)) value += 1
        }
      }
    }
    solution += valueMap[value-1]
  }
  println(solution)
}